import React, { useEffect, useState } from "react";

const ListingDashboard = () => {
  const [listings, setListings] = useState({});

  useEffect(() => {
    fetch("/api/displaylistings")

      .then(res => 
        res.json()
      )

      .then(data =>
        setListings(data)
  )

  .catch(err => console.error(err));

  }, []);


    const tableBody = document.getElementsByTagName("tbody");
    const tableRow = document.createElement("tr");



  return (
    <div className="flex h-screen w-full justify-center items-start py-5">
      <div>
        <table>
          <thead>
            <tr className="flex gap-24">
              <th>Property Title</th>
              <th>Description</th>
              <th>Price</th>
              <th>Images</th>
              <th>Location</th>
              <th>Agent Email</th>
            </tr>
          </thead>

          <tbody>   
          {
              listings.map((property, index) => (
                <tr key={index} className="flex gap-24">
                  <td>{property.title}</td>
                  <td>{property.description}</td>
                  <td>{property.price}</td>
                  <td>{property.location}</td>
                  <td>{property.agent_contact}</td>
                </tr>
              ))
            }

      </tbody>
        </table>
      </div>
    </div>
  );
};

export default ListingDashboard;
